/*INICIO DE TRATAMENTO ARV - NUM PERIODO: INCLUI TRANSFERIDOS DE COM DATA DE INICIO CONHECIDA (SQL)*/
INSERT INTO serialized_object (name,description,type,subtype,serialization_class,serialized_data,date_created,creator,date_changed,changed_by,retired,date_retired,retired_by,retire_reason,uuid) VALUES ('INICIO DE TRATAMENTO ARV - NUM PERIODO: INCLUI TRANSFERIDOS DE COM DATA DE INICIO CONHECIDA (SQL)','Paciente que iniciou o tratamento ARV (Na unidade sanitaria seleccionada). Sao inclusos os transferidos de com data de inicio conhecida','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"91787a86-0362-4820-a4ee-025d5501198b\" retired=\"false\">\n  <name>INICIO DE TRATAMENTO ARV - NUM PERIODO: INCLUI TRANSFERIDOS DE COM DATA DE INICIO CONHECIDA (SQL)</name>\n  <description>Paciente que iniciou o tratamento ARV (Na unidade sanitaria seleccionada). Sao inclusos os transferidos de com data de inicio conhecida</description>\n  <changedBy id=\"2\" uuid=\"85a09a66-1e3d-11e0-acca-000c29d83bf2\"/>\n  <dateChanged id=\"3\">2019-10-15 10:25:28 CAT</dateChanged>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>Data Inicial</label>\n      <type>java.util.Date</type>\n      <required>false</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>endDate</name>\n      <label>Data Final</label>\n      <type>java.util.Date</type>\n      <required>false</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>US</label>\n      <type>org.openmrs.Location</type>\n      <required>false</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>573</id>\n  <query>select patient_id&#xd;\nfrom&#xd;\n(	Select patient_id,min(data_inicio) data_inicio&#xd;\n		from&#xd;\n			(	&#xd;\n			&#xd;\n				/*Patients on ART who initiated the ARV DRUGS: ART Regimen Start Date*/&#xd;\n				&#xd;\n				Select 	p.patient_id,min(e.encounter_datetime) data_inicio&#xd;\n				from 	patient p &#xd;\n						inner join encounter e on p.patient_id=e.patient_id	&#xd;\n						inner join obs o on o.encounter_id=e.encounter_id&#xd;\n				where 	e.voided=0 and o.voided=0 and p.voided=0 and &#xd;\n						e.encounter_type in (18,6,9) and o.concept_id=1255 and o.value_coded=1256 and &#xd;\n						e.encounter_datetime&lt;=:endDate and e.location_id=:location&#xd;\n				group by p.patient_id&#xd;\n		&#xd;\n				union&#xd;\n		&#xd;\n				/*Patients on ART who have art start date: ART Start date*/&#xd;\n				Select 	p.patient_id,min(value_datetime) data_inicio&#xd;\n				from 	patient p&#xd;\n						inner join encounter e on p.patient_id=e.patient_id&#xd;\n						inner join obs o on e.encounter_id=o.encounter_id&#xd;\n				where 	p.voided=0 and e.voided=0 and o.voided=0 and e.encounter_type in (18,6,9,53) and &#xd;\n						o.concept_id=1190 and o.value_datetime is not null and &#xd;\n						o.value_datetime&lt;=:endDate and e.location_id=:location&#xd;\n				group by p.patient_id&#xd;\n&#xd;\n				union&#xd;\n&#xd;\n				/*Patients enrolled in ART Program: OpenMRS Program*/&#xd;\n				select 	pg.patient_id,min(date_enrolled) data_inicio&#xd;\n				from 	patient p inner join patient_program pg on p.patient_id=pg.patient_id&#xd;\n				where 	pg.voided=0 and p.voided=0 and program_id=2 and date_enrolled&lt;=:endDate and location_id=:location&#xd;\n				group by pg.patient_id&#xd;\n				&#xd;\n				union&#xd;\n				&#xd;\n				&#xd;\n				/*Patients with first drugs pick up date set in Pharmacy: First ART Start Date*/&#xd;\n				  SELECT 	e.patient_id, MIN(e.encounter_datetime) AS data_inicio &#xd;\n				  FROM 		patient p&#xd;\n							inner join encounter e on p.patient_id=e.patient_id&#xd;\n				  WHERE		p.voided=0 and e.encounter_type=18 AND e.voided=0 and e.encounter_datetime&lt;=:endDate and e.location_id=:location&#xd;\n				  GROUP BY 	p.patient_id&#xd;\n			  &#xd;\n				union&#xd;\n				&#xd;\n				/*Patients with first drugs pick up date set: Recepcao Levantou ARV*/&#xd;\n				Select 	p.patient_id,min(value_datetime) data_inicio&#xd;\n				from 	patient p&#xd;\n						inner join encounter e on p.patient_id=e.patient_id&#xd;\n						inner join obs o on e.encounter_id=o.encounter_id&#xd;\n				where 	p.voided=0 and e.voided=0 and o.voided=0 and e.encounter_type=52 and &#xd;\n						o.concept_id=23866 and o.value_datetime is not null and &#xd;\n						o.value_datetime&lt;=:endDate and e.location_id=:location&#xd;\n				group by p.patient_id					&#xd;\n				&#xd;\n				&#xd;\n			) inicio_real&#xd;\n		group by patient_id	&#xd;\n	)inicio&#xd;\nwhere data_inicio between :startDate and :endDate</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2019-10-15 10:25:28',13,'2019-10-15 10:25:28',13,0,NULL,NULL,NULL,'91787a86-0362-4820-a4ee-025d5501198b') 
