/*PROGRAMA: PACIENTES TRANSFERIDOS DE NO PROGRAMA DE TRATAMENTO ARV: NUM PERIODO*/
INSERT INTO serialized_object (name,description,type,subtype,serialization_class,serialized_data,date_created,creator,date_changed,changed_by,retired,date_retired,retired_by,retire_reason,uuid) VALUES ('PROGRAMA: PACIENTES TRANSFERIDOS DE NO PROGRAMA DE TRATAMENTO ARV: NUM PERIODO','Sao pacientes que entraram no programa de tratamento ARV num periodo vindos transferidos de','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"91388069-6580-463a-b9a1-f96f74f83004\" retired=\"false\">\n  <name>PROGRAMA: PACIENTES TRANSFERIDOS DE NO PROGRAMA DE TRATAMENTO ARV: NUM PERIODO</name>\n  <description>São pacientes que entraram no programa de tratamento ARV num periodo vindos transferidos de</description>\n  <creator id=\"2\" uuid=\"85a09a66-1e3d-11e0-acca-000c29d83bf2\"/>\n  <dateCreated id=\"3\">2013-09-23 12:40:09 UTC</dateCreated>\n  <changedBy id=\"4\" uuid=\"85a05c5e-1e3d-11e0-acca-000c29d83bf2\"/>\n  <dateChanged id=\"5\">2020-06-04 08:44:27 UTC</dateChanged>\n  <parameters id=\"6\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>false</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>false</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>false</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>801</id>\n  <query>select minState.patient_id from  (&#xd;\n            SELECT p.patient_id, pg.patient_program_id, MIN(ps.start_date) as minStateDate  FROM patient p  &#xd;\n            inner join patient_program pg on p.patient_id=pg.patient_id &#xd;\n            inner join patient_state ps on pg.patient_program_id=ps.patient_program_id &#xd;\n            WHERE pg.voided=0 and ps.voided=0 and p.voided=0 and pg.program_id=2 and location_id=:location  and ps.start_date BETWEEN :startDate and :endDate &#xd;\n            GROUP BY pg.patient_program_id) minState &#xd;\n            inner join patient_state ps on ps.patient_program_id=minState.patient_program_id &#xd;\n            where ps.start_date=minState.minStateDate and ps.state=29 and ps.voided=0 ;</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2013-09-23 14:40:09',13,'2015-07-07 17:23:25',13,0,NULL,NULL,NULL,'91388069-6580-463a-b9a1-f96f74f83004')
