ings id=\"12\">\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>ACTIVOTARV</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"13\">\n        <parameterizable class=\"org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition\" id=\"14\" uuid=\"44b0aaea-1540-4541-b1ec-a92599dfea4a\"/>\n        <parameterMappings id=\"15\">\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>CVANTERIOR</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"16\">\n        <parameterizable class=\"org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition\" id=\"17\" uuid=\"ddd708cb-9d5c-4b17-8dde-6bcbbfa819e1\"/>\n        <parameterMappings reference=\"12\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </searches>\n</org.openmrs.module.reporting.cohort.definition.CompositionCohortDefinition>'
