/*PACIENTES TRANSFERIDOS PARA ATe UM PERIODO FINAL*/
INSERT INTO serialized_object (name,description,type,subtype,serialization_class,serialized_data,date_created,creator,date_changed,changed_by,retired,date_retired,retired_by,retire_reason,uuid) VALUES ('PACIENTES TRANSFERIDOS PARA ATe UM PERIODO FINAL','Sao pacientes que foram transferidos para atraves de varias fontes: Programa TARV, Cartao de Visita domiciliaria, Ficha Clinica, Ficha Resumo. Mas que se ele tiver uma consulta ou levantamento recente nao e considerado como transferido para','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"fb4bec1c-fec4-4091-a26a-775d43e432ab\" retired=\"false\">\n  <name>PACIENTES TRANSFERIDOS PARA ATe UM PERIODO FINAL</name>\n  <description>Sao pacientes que foram transferidos para atraves de varias fontes: Programa TARV, Cartao de Visita domiciliaria, Ficha Clinica, Ficha Resumo. Mas que se ele tiver uma consulta ou levantamento recente nao e considerado como transferido para</description>\n  <creator id=\"2\" uuid=\"85a05c5e-1e3d-11e0-acca-000c29d83bf2\"/>\n  <dateCreated id=\"3\">2020-02-04 16:24:27 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2020-05-29 09:56:25 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>endDate</name>\n      <label>Data Final</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>US</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>2259</id>\n  <query>select transferidopara.patient_id&#xd;\nfrom &#xd;\n(&#xd;\n	select patient_id,max(data_transferidopara) data_transferidopara&#xd;\n	from &#xd;\n	(&#xd;\n		/*Programa*/&#xd;\n		select 	pg.patient_id,max(ps.start_date) data_transferidopara&#xd;\n		from 	patient p &#xd;\n				inner join patient_program pg on p.patient_id=pg.patient_id&#xd;\n				inner join patient_state ps on pg.patient_program_id=ps.patient_program_id&#xd;\n		where 	pg.voided=0 and ps.voided=0 and p.voided=0 and &#xd;\n				pg.program_id=2 and ps.state=7 and ps.end_date is null and &#xd;\n				ps.start_date&lt;=:endDate and location_id=:location&#xd;\n		group by p.patient_id&#xd;\n&#xd;\n		union&#xd;\n		/*Cartao de Visita*/		&#xd;\n		select 	p.patient_id,max(e.encounter_datetime) data_transferidopara&#xd;\n		from	patient p&#xd;\n				inner join encounter e on p.patient_id=e.patient_id&#xd;\n				inner join obs o on o.encounter_id=e.encounter_id&#xd;\n		where 	e.voided=0 and p.voided=0 and e.encounter_datetime&lt;=:endDate and&#xd;\n				o.voided=0 and o.concept_id=2016 and o.value_coded in (1706,23863) and e.encounter_type=21 and  e.location_id=:location&#xd;\n		group by p.patient_id&#xd;\n&#xd;\n		union&#xd;\n		/*Ficha Resumo*/&#xd;\n		select 	p.patient_id,max(o.obs_datetime) data_transferidopara&#xd;\n		from	patient p&#xd;\n				inner join encounter e on p.patient_id=e.patient_id&#xd;\n				inner join obs o on o.encounter_id=e.encounter_id&#xd;\n		where 	e.voided=0 and p.voided=0 and o.obs_datetime&lt;=:endDate and&#xd;\n				o.voided=0 and o.concept_id=6272 and o.value_coded=1706 and e.encounter_type=53 and  e.location_id=:location&#xd;\n		group by p.patient_id&#xd;\n&#xd;\n		union&#xd;\n		/*Ficha Clinica*/&#xd;\n		select 	p.patient_id,max(e.encounter_datetime) data_transferidopara&#xd;\n		from	patient p&#xd;\n				inner join encounter e on p.patient_id=e.patient_id&#xd;\n				inner join obs o on o.encounter_id=e.encounter_id&#xd;\n		where 	e.voided=0 and p.voided=0 and e.encounter_datetime&lt;=:endDate and&#xd;\n				o.voided=0 and o.concept_id=6273 and o.value_coded=1706 and e.encounter_type=6 and  e.location_id=:location&#xd;\n		group by p.patient_id&#xd;\n	) transferido&#xd;\n	group by patient_id&#xd;\n) transferidopara&#xd;\ninner join &#xd;\n(&#xd;\n	select patient_id,max(encounter_datetime) encounter_datetime&#xd;\nfrom &#xd;\n	(&#xd;\n		select p.patient_id,max(e.encounter_datetime) encounter_datetime&#xd;\n		from 	patient p&#xd;\n				inner join encounter e on e.patient_id=p.patient_id&#xd;\n		where 	p.voided=0 and e.voided=0 and e.encounter_datetime&lt;=:endDate and &#xd;\n				e.location_id=:location and e.encounter_type in (18,6,9)&#xd;\n		group by p.patient_id&#xd;\n&#xd;\n		union&#xd;\n&#xd;\n		Select 	p.patient_id,max(value_datetime) encounter_datetime&#xd;\n		from 	patient p&#xd;\n				inner join encounter e on p.patient_id=e.patient_id&#xd;\n				inner join obs o on e.encounter_id=o.encounter_id&#xd;\n		where 	p.voided=0 and e.voided=0 and o.voided=0 and e.encounter_type=52 and &#xd;\n				o.concept_id=23866 and o.value_datetime is not null and &#xd;\n				o.value_datetime&lt;=:endDate and e.location_id=:location&#xd;\n		group by p.patient_id&#xd;\n	) maxFilaRecepcao&#xd;\ngroup by patient_id&#xd;\n&#xd;\n&#xd;\n	&#xd;\n) consultaOuARV on transferidopara.patient_id=consultaOuARV.patient_id&#xd;\nwhere consultaOuARV.encounter_datetime&lt;=transferidopara.data_transferidopara</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2020-02-04 18:24:27',1,'2020-05-29 11:56:25',1,0,NULL,NULL,NULL,'fb4bec1c-fec4-4091-a26a-775d43e432ab')
