/*PACIENTES COM RESULTADO DE CARGA VIRAL REGISTADA NA FICHA CLINICA MAS QUE NAO E A PRIMEIRA DO ANO*/
INSERT INTO serialized_object (name,description,type,subtype,serialization_class,serialized_data,date_created,creator,date_changed,changed_by,retired,date_retired,retired_by,retire_reason,uuid) VALUES ('PACIENTES COM RESULTADO DE CARGA VIRAL REGISTADA NA FICHA CLINICA MAS QUE NAO E A PRIMEIRA DO ANO','Sao pacientes com resultado de carga viral registada dentro do periodo introduzido mas que nao e a primeira durante o ano de relatorio MISAU','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"ddd708cb-9d5c-4b17-8dde-6bcbbfa819e1\" retired=\"false\">\n  <name>PACIENTES COM RESULTADO DE CARGA VIRAL REGISTADA NA FICHA CLINICA MAS QUE NAO E A PRIMEIRA DO ANO</name>\n  <description>Sao pacientes com resultado de carga viral registada dentro do periodo introduzido mas que nao e a primeira durante o ano de relatorio MISAU</description>\n  <creator id=\"2\" uuid=\"85a05c5e-1e3d-11e0-acca-000c29d83bf2\"/>\n  <dateCreated id=\"3\">2020-06-02 07:07:26 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2020-06-02 07:09:18 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Data Inicial</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>Data Final</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>US</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>2371</id>\n  <query>SELECT 	p.patient_id &#xd;\nFROM 	patient p &#xd;\n		JOIN encounter e ON p.patient_id=e.patient_id &#xd;\n		JOIN obs o ON e.encounter_id=o.encounter_id &#xd;\n        JOIN &#xd;\n		(	SELECT 	pat.patient_id AS patient_id, enc.encounter_datetime AS endDate &#xd;\n			FROM 	patient pat &#xd;\n					JOIN encounter enc ON pat.patient_id=enc.patient_id JOIN obs ob ON enc.encounter_id=ob.encounter_id &#xd;\n            WHERE 	pat.voided = 0 AND enc.voided = 0 AND ob.voided = 0 AND enc.location_id = :location &#xd;\n					AND enc.encounter_datetime BETWEEN :startDate AND :endDate AND enc.encounter_type in (6,9) AND ob.concept_id in (856,1305)&#xd;\n		) ed &#xd;\n        ON p.patient_id=ed.patient_id &#xd;\nWHERE 	p.voided = 0 AND e.voided = 0 AND o.voided = 0 &#xd;\n        AND e.location_id = :location AND e.encounter_datetime BETWEEN &#xd;\n        IF(MONTH(:startDate) = 12  &amp;&amp; DAY(:startDate) = 21, :startDate, CONCAT(YEAR(:startDate)-1, &apos;-12&apos;,&apos;-21&apos;)) &#xd;\n             AND (:startDate -interval 1 day) AND e.encounter_type in (6,9) &#xd;\n             AND o.concept_id in (856,1305);&#xd;\n</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2020-06-02 09:07:26',1,'2020-06-02 09:09:19',1,0,NULL,NULL,NULL,'ddd708cb-9d5c-4b17-8dde-6bcbbfa819e1')
