/*PACIENTES INSCRITOS NO SERVICO TARV - PERIODO FINAL (SQL): ADULTOS*/
INSERT INTO serialized_object (name,description,type,subtype,serialization_class,serialized_data,date_created,creator,date_changed,changed_by,retired,date_retired,retired_by,retire_reason,uuid) VALUES ('PACIENTES INSCRITOS NO SERVICO TARV - PERIODO FINAL (SQL): ADULTOS','Pacientes inscritos no servico TARV: Define-se a inscricao neste caso como 1) Abertura do processo clinico Parte A (Adulto ou Pediatria) 2) Inscricao no progrma Cuidado. Idade actual maior ou igual a 15 anos','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"6f07e92c-02c8-44f1-81a4-b1c9ede17c1f\" retired=\"false\">\n  <name>PACIENTES INSCRITOS NO SERVICO TARV - PERIODO FINAL (SQL): ADULTOS</name>\n  <description>Pacientes inscritos no servico TARV: Define-se a inscricao neste caso como 1) Abertura do processo clinico Parte A (Adulto ou Pediatria) 2) Inscricao no progrma Cuidado. Idade actual maior ou igual a 15 anos</description>\n  <creator id=\"2\" uuid=\"85a05c5e-1e3d-11e0-acca-000c29d83bf2\"/>\n  <dateCreated id=\"3\">2020-06-02 08:58:00 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2020-06-02 09:11:49 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>endDate</name>\n      <label>Data Final</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>US</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>2372</id>\n  <query>select inscrito.patient_id&#xd;\nfrom &#xd;\n(&#xd;\n	select p.patient_id &#xd;\n	from patient p inner join encounter e on e.patient_id=p.patient_id &#xd;\n	where e.voided=0 and p.voided=0 and e.encounter_type in (5,7) and e.encounter_datetime&lt;=:endDate and e.location_id = :location&#xd;\n&#xd;\n	union&#xd;\n&#xd;\n	select 	pg.patient_id&#xd;\n	from 	patient p inner join patient_program pg on p.patient_id=pg.patient_id&#xd;\n	where 	pg.voided=0 and p.voided=0 and program_id in (1,2) and date_enrolled&lt;=:endDate and location_id=:location&#xd;\n&#xd;\n	union&#xd;\n&#xd;\n	Select 	p.patient_id&#xd;\n	from 	patient p&#xd;\n			inner join encounter e on p.patient_id=e.patient_id&#xd;\n			inner join obs o on e.encounter_id=o.encounter_id&#xd;\n	where 	p.voided=0 and e.voided=0 and o.voided=0 and e.encounter_type=53 and &#xd;\n			o.concept_id=23891 and o.value_datetime is not null and &#xd;\n			o.value_datetime&lt;=:endDate and e.location_id=:location&#xd;\n) inscrito&#xd;\ninner join person pe on pe.person_id=inscrito.patient_id&#xd;\nwhere timestampdiff(YEAR,pe.birthdate,:endDate)&gt;=15</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2020-06-02 10:58:00',1,'2020-06-02 11:11:49',1,0,NULL,NULL,NULL,'6f07e92c-02c8-44f1-81a4-b1c9ede17c1f')
