/*POPULACAO CHAVE: PERIODO FINAL - RECLUSO*/
INSERT INTO serialized_object (name,description,type,subtype,serialization_class,serialized_data,date_created,creator,date_changed,changed_by,retired,date_retired,retired_by,retire_reason,uuid) VALUES ('POPULACAO CHAVE: PERIODO FINAL - RECLUSO','Sao pacientes que foram registados como reclusos na ficha clinica ou ficha de apoio psico social ate o periodo final','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"daa154c7-b778-4a82-ad3c-a10f77190a23\" retired=\"false\">\n  <name>POPULACAO CHAVE: PERIODO FINAL - RECLUSO</name>\n  <description>Sao pacientes que foram registados como reclusos na ficha clinica ou ficha de apoio psico social ate o periodo final</description>\n  <creator id=\"2\" uuid=\"85a09a66-1e3d-11e0-acca-000c29d83bf2\"/>\n  <dateCreated id=\"3\">2019-10-16 11:17:28 UTC</dateCreated>\n  <changedBy id=\"4\" uuid=\"85a05c5e-1e3d-11e0-acca-000c29d83bf2\"/>\n  <dateChanged id=\"5\">2020-06-05 09:35:44 UTC</dateChanged>\n  <parameters id=\"6\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>Data Final</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>US</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>2175</id>\n  <query>select patient_id&#xd;\nfrom &#xd;\n(&#xd;\n	select *&#xd;\n	from&#xd;\n	(&#xd;\n		select *&#xd;\n		from &#xd;\n		(&#xd;\n			select maxkp.patient_id, o.value_coded,o.obs_datetime,1 ordemSource,1 ordemKp&#xd;\n			from &#xd;\n			(	Select 	p.patient_id,max(e.encounter_datetime) maxkpdate&#xd;\n				from 	patient p &#xd;\n						inner join encounter e on p.patient_id=e.patient_id&#xd;\n						inner join obs o on e.encounter_id=o.encounter_id&#xd;\n				where 	p.voided=0 and e.voided=0 and o.voided=0 and concept_id=23703 and &#xd;\n						e.encounter_type=6 and e.encounter_datetime&lt;=:endDate and &#xd;\n						e.location_id=:location&#xd;\n				group by p.patient_id&#xd;\n			) maxkp&#xd;\n			inner join encounter e on e.patient_id=maxkp.patient_id and maxkp.maxkpdate=e.encounter_datetime&#xd;\n			inner join obs o on o.encounter_id=e.encounter_id and maxkp.maxkpdate=o.obs_datetime &#xd;\n			where o.concept_id=23703 and o.voided=0 and e.encounter_type=6 and e.voided=0 and e.location_id=:location and o.value_coded in (20454,20426)&#xd;\n			&#xd;\n			union&#xd;\n			&#xd;\n			select maxkp.patient_id, o.value_coded,o.obs_datetime,1 ordemSource,1 ordemKp&#xd;\n			from &#xd;\n			(	Select 	p.patient_id,max(e.encounter_datetime) maxkpdate&#xd;\n				from 	patient p &#xd;\n						inner join encounter e on p.patient_id=e.patient_id&#xd;\n						inner join obs o on e.encounter_id=o.encounter_id&#xd;\n				where 	p.voided=0 and e.voided=0 and o.voided=0 and concept_id=23703 and &#xd;\n						e.encounter_type=6 and e.encounter_datetime&lt;=:endDate and &#xd;\n						e.location_id=:location&#xd;\n				group by p.patient_id&#xd;\n			) maxkp&#xd;\n			inner join encounter e on e.patient_id=maxkp.patient_id and maxkp.maxkpdate=e.encounter_datetime&#xd;\n			inner join obs o on o.encounter_id=e.encounter_id and maxkp.maxkpdate=o.obs_datetime&#xd;\n			inner join person pe on pe.person_id=maxkp.patient_id&#xd;\n			where 	o.concept_id=23703 and o.voided=0 and e.encounter_type=6 and e.voided=0 and e.location_id=:location and pe.voided=0 and &#xd;\n					((pe.gender=&apos;F&apos; and o.value_coded=1901) or  (pe.gender=&apos;M&apos; and o.value_coded=1377))&#xd;\n			&#xd;\n			union&#xd;\n			&#xd;\n			select maxkp.patient_id, o.value_coded,o.obs_datetime,2 ordemSource,if(o.value_coded=20454,2,4) ordemKp&#xd;\n			from &#xd;\n			(	Select 	p.patient_id,max(e.encounter_datetime) maxkpdate&#xd;\n				from 	patient p &#xd;\n						inner join encounter e on p.patient_id=e.patient_id&#xd;\n						inner join obs o on e.encounter_id=o.encounter_id&#xd;\n				where 	p.voided=0 and e.voided=0 and o.voided=0 and concept_id=23703 and &#xd;\n						e.encounter_type in (46,35) and e.encounter_datetime&lt;=:endDate and &#xd;\n						e.location_id=:location&#xd;\n				group by p.patient_id&#xd;\n			) maxkp&#xd;\n			inner join encounter e on e.patient_id=maxkp.patient_id and maxkp.maxkpdate=e.encounter_datetime&#xd;\n			inner join obs o on o.encounter_id=e.encounter_id and maxkp.maxkpdate=o.obs_datetime &#xd;\n			where o.concept_id=23703 and o.voided=0 and e.encounter_type in (46,35) and e.voided=0 and e.location_id=:location and o.value_coded in (20454,20426)&#xd;\n			&#xd;\n			union&#xd;\n			&#xd;\n			select maxkp.patient_id, o.value_coded,o.obs_datetime,2 ordemSource,3 ordemKp&#xd;\n			from &#xd;\n			(	Select 	p.patient_id,max(e.encounter_datetime) maxkpdate&#xd;\n				from 	patient p &#xd;\n						inner join encounter e on p.patient_id=e.patient_id&#xd;\n						inner join obs o on e.encounter_id=o.encounter_id&#xd;\n				where 	p.voided=0 and e.voided=0 and o.voided=0 and concept_id=23703 and &#xd;\n						e.encounter_type in (46,35) and e.encounter_datetime&lt;=:endDate and &#xd;\n						e.location_id=:location&#xd;\n				group by p.patient_id&#xd;\n			) maxkp&#xd;\n			inner join encounter e on e.patient_id=maxkp.patient_id and maxkp.maxkpdate=e.encounter_datetime&#xd;\n			inner join obs o on o.encounter_id=e.encounter_id and maxkp.maxkpdate=o.obs_datetime &#xd;\n			inner join person pe on pe.person_id=maxkp.patient_id&#xd;\n			where 	o.concept_id=23703 and o.voided=0 and e.encounter_type in (46,35) and e.voided=0 and e.location_id=:location and pe.voided=0 and &#xd;\n					((pe.gender=&apos;F&apos; and o.value_coded=1901) or  (pe.gender=&apos;M&apos; and o.value_coded=1377))&#xd;\n&#xd;\n			union &#xd;\n&#xd;\n			Select 	pa.person_id,&#xd;\n					case upper(pa.value)&#xd;\n							when &apos;HSM&apos; then 1377&#xd;\n							when &apos;HSH&apos; then 1377&#xd;\n							when &apos;MSM&apos; then 1377&#xd;\n							when &apos;MTS&apos; then 1901&#xd;\n							when &apos;CSW&apos; then 1901&#xd;\n							when &apos;TS&apos; then 1901&#xd;\n							when &apos;PRISONER&apos; then 20426&#xd;\n							when &apos;REC&apos; then 20426&#xd;\n							when &apos;RC&apos; then 20426&#xd;\n							when &apos;PID&apos; then 20454				&#xd;\n							else null end as estado,&#xd;\n					date(pa.date_created),&#xd;\n					3 as ordemSource,&#xd;\n					5 as ordemKp&#xd;\n			from 	person_attribute pa&#xd;\n					inner join person_attribute_type pat on pa.person_attribute_type_id=pat.person_attribute_type_id&#xd;\n			where 	pat.uuid=&apos;c89c90eb-5b03-4899-ab9f-06fecd123511&apos; and pa.value is not null and pa.value&lt;&gt;&apos;&apos; and pa.voided=0 and date(pa.date_created)&lt;=:endDate&#xd;\n		) allkpsource&#xd;\n		order by patient_id,obs_datetime desc,ordemSource,ordemKp&#xd;\n	) allkpsorcetakefirst&#xd;\n	group by patient_id&#xd;\n) finalkptable&#xd;\nwhere value_coded=20426</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2019-10-16 13:17:28',13,'2020-06-02 08:56:11',1,0,NULL,NULL,NULL,'daa154c7-b778-4a82-ad3c-a10f77190a23')
