n&#xd;\n				group by p.patient_id&#xd;\n			) maxkp&#xd;\n			inner join encounter e on e.patient_id=maxkp.patient_id and maxkp.maxkpdate=e.encounter_datetime&#xd;\n			inner join obs o on o.encounter_id=e.encounter_id and maxkp.maxkpdate=o.obs_datetime &#xd;\n			where o.concept_id=23703 and o.voided=0 and e.encounter_type in (46,35) and e.voided=0 and e.location_id=:location and o.value_coded in (20454,20426)&#xd;\n			&#xd;\n			union&#xd;\n			&#xd;\n			select maxkp.patient_id, o.value_coded,o.obs_datetime,2 ordemSource,3 ordemKp&#xd;\n			from &#xd;\n			(	Select 	p.patient_id,max(e.encounter_datetime) maxkpdate&#xd;\n				from 	patient p &#xd;\n						inner join encounter e on p.patient_id=e.patient_id&#xd;\n						inner join obs o on e.encounter_id=o.encounter_id&#xd;\n				where 	p.voided=0 and e.voided=0 and o.voided=0 and concept_id=23703 and &#xd;\n						e.encounter_type in (46,35) and e.encounter_datetime&lt;=:endDate and &#xd;\n						e.location_id=:location&#xd;\n				group by p.patient_id&#xd;\n			) maxkp&#xd;\n			inner join encounter e on e.patient_id=maxkp.patient_id and maxkp.maxkpdate=e.encounter_datetime&#xd;\n			inner join obs o on o.encounter_id=e.encounter_id and maxkp.maxkpdate=o.obs_datetime &#xd;\n			inner join person pe on pe.person_id=maxkp.patient_id&#xd;\n			where 	o.concept_id=23703 and o.voided=0 and e.encounter_type in (46,35) and e.voided=0 and e.location_id=:location and pe.voided=0 and &#xd;\n					((pe.gender=&apos;F&apos; and o.value_coded=1901) or  (pe.gender=&apos;M&apos; and o.value_coded=1377))&#xd;\n&#xd;\n			union &#xd;\n&#xd;\n			Select 	pa.person_id,&#xd;\n					case upper(pa.value)&#xd;\n							when &apos;HSM&apos; then 1377&#xd;\n							when &apos;HSH&apos; then 1377&#xd;\n							when &apos;MSM&apos; then 1377&#xd;\n							when &apos;MTS&apos; then 1901&#xd;\n							when &apos;CSW&apos; then 1901&#xd;\n							when &apos;TS&apos; then 1901&#xd;\n							when &apos;PRISONER&apos; then 20426&#xd;\n							when &apos;REC&apos; then 20426&#xd;\n							when &apos;RC&apos; then 20426&#xd;\n							when &apos;PID&apos; then 20454				&#xd;\n							else null end as estado,&#xd;\n					date(pa.date_created),&#xd;\n					3 as ordemSource,&#xd;\n					5 as ordemKp&#xd;\n			from 	person_attribute pa&#xd;\n					inner join person_attribute_type pat on pa.person_attribute_type_id=pat.person_attribute_type_id&#xd;\n			where 	pat.uuid=&apos;c89c90eb-5b03-4899-ab9f-06fecd123511&apos; and pa.value is not null and pa.value&lt;&gt;&apos;&apos; and pa.voided=0 and date(pa.date_created)&lt;=:endDate&#xd;\n		) allkpsource&#xd;\n		order by patient_id,obs_datetime desc,ordemSource,ordemKp&#xd;\n	) allkpsorcetakefirst&#xd;\n	group by patient_id&#xd;\n) finalkptable&#xd;\nwhere value_coded=1901</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>'
